  --font-size: 14px;
  --line-height: 1.4;
  --half-line-height: calc(var(--line-height) * var(--font-size) / 2);
  --half-line-height: round(calc(var(--line-height) * var(--font-size) / 2), 1px);

  --primary-bg-color: hsl(0 0% 98.8%);
  --secondary-bg-color: hsl(0 0% 99.6%);
  --font-color: hsl(0 0% 7%);
  --subtitle-color: hsl(0 1% 32%);
  --accent-color: hsl(221 93% 47%);
  --link-visited-color: hsl(271 68% 32%);

  --passed-color: hsl(120 100% 16%);
  --failed-color: hsl(0 100% 31%);
  --unknown-color: hsl(300 100% 27%);
  --skipped-color: hsl(0 0% 30%);
  --broken-color: hsl(39 100% 21%);
  --manual-color: hsl(80 100% 17%);

  --transparent-color: hsl(0 0% 0% / 0%);
  --color-cell-color: hsl(0 0% 95%);
  --button-disabled-color: hsl(0 0% 5% / 0.3);

  --header-height: 70px;
  --retry-padding: 10px;
  --test-details-padding: 10px;
  --main-radius: 3px;
  --item-bg-color: hsl(0 0% 63% / 0.07);
  --failed-status-bg-color: hsl(0 100% 63% / 0.07);
  --step-panel-bg-color: hsl(0 0% 89%);
  --item-hover-bg-color: hsl(215 98% 61% /0.15);

  --drag-container-width: 8px;
  --drag-container-color: hsl(0 0% 60%);
  --drag-container-bg-color: hsl(0 0% 83%);

  --main-params-color: hsl(0 0% 30%);
  --tests-counters-by-status-cell-bg-color: var(--primary-bg-color);
  --failed-line-color: hsl(0 100% 35%);
  --failed-text-color: hsl(4, 64%, 23%);
}

@media (prefers-color-scheme: dark) {
  :root {
    --primary-bg-color: hsl(240 8.77% 11.18%);
    --secondary-bg-color: hsl(240 5.56% 14.12%);
    --font-color: hsl(0 0% 100% / 0.75);
    --subtitle-color: hsl(0 0% 66%);
    --accent-color: hsl(221 91% 75%);
    --drag-container-color: hsl(0 0% 75%);
    --drag-container-bg-color: hsl(0 0% 32%);
    --step-panel-bg-color: hsl(210 12% 16%);
    --button-disabled-color: hsl(0 0% 60% / 0.3);
    --link-visited-color: hsl(271 69% 76%);

    --passed-color: hsl(120 100% 41%);
    --failed-color: hsl(0 100% 76%);
    --unknown-color: hsl(300 100% 80%);
    --skipped-color: hsl(0 0% 70%);
    --broken-color: hsl(39 100% 50%);
    --manual-color: hsl(80 100% 36%);

    --main-params-color: hsl(0 0% 65%);
    --failed-line-color: hsl(0 100% 74%);
    --failed-text-color: var(--font-color);
    --color-cell-color: hsl(0 0% 7%);
  }

  .logo > svg *[fill='#084EE8'] {
    fill: hsl(220 93% 56%);
  }
  .logo > svg *[fill='#000'] {
    fill: hsl(0 0% 65%);
  }
}
body {
  display: grid;
  grid-template-areas: 'header' 'column-1' 'main';
  grid-template-rows: auto auto 1fr;
  grid-template-columns: 1fr;
  margin: 0;
  padding: 0;
  width: 100%;
  min-height: 100vh;
  font-family: system-ui;
  font-size: var(--font-size);
  line-height: var(--line-height);
  color: var(--font-color);
  background-color: var(--primary-bg-color);
}
body:has(dialog[open]) {
  overflow: hidden;
}
button,
button:focus,
button:active,
button:hover {
  box-sizing: border-box;
  border: none;
  font-family: system-ui;
  cursor: pointer;
  background-color: transparent;
  background: none;
  user-select: text;
}
button:disabled {
  color: var(--button-disabled-color);
  cursor: not-allowed;
}
a,
a:hover,
a:active,
a:focus {
  color: var(--accent-color);
}
a:visited {
  color: var(--link-visited-color);
}
.errors,
.warnings {
  padding: 2px var(--retry-padding);
  overflow-wrap: break-word;
}
.errors__error {
  margin: 4px 0;
  color: var(--failed-color);
}
.warnings__error {
  margin: 4px 0;
  color: var(--broken-color);
}
.header {
  grid-area: header;
  display: flex;
  justify-content: flex-start;
  margin: 0;
  padding: 4px 14px;
  box-sizing: border-box;
}
.logo {
  display: block;
  width: 100px;
  height: auto;
}
.column-1 {
  grid-area: column-1;
  width: 100vw;
}
.header,
.column-1 {
  border-bottom: 1px solid var(--drag-container-bg-color);
}
.retry-links {
  display: flex;
  flex-direction: row;
  max-width: 100vw;
  overflow-x: scroll;
}
.retry-link {
  padding: 14px;
  box-sizing: border-box;
  flex-shrink: 0;
  font-size: 16px;
  color: var(--font-color);
  text-align: left;
  transition: all 0.3s ease;
  white-space: nowrap;
  text-decoration: none;
  border: none;
}
.retry-link[aria-current='true'] {
  box-shadow: 0 -3px 0 0 var(--accent-color) inset;
  border-radius: inherit;
  background: var(--item-bg-color);
}
.main {
  overflow: hidden;
  contain: layout;
  container-type: inline-size;
  grid-area: main;
  min-width: 0;
  display: flex;
  flex-direction: column;
}
.column-1 {
  width: 100%;
}
.column-2 {
  flex-basis: auto;
}
.column-2,
.column-3 {
  min-width: 180px;
  padding-bottom: 25px;
}
.column-1,
.column-2 {
  contain: layout paint;
}
.column-1,
.column-2,
.column-3 {
  height: auto;
  box-sizing: border-box;
}
.retry__title {
  margin: 0;
  padding: 14px var(--retry-padding) 10px;
  font-size: 22px;
  font-weight: normal;
}
.retry__date {
  margin: 0 0 15px 0;
  padding: 0 var(--retry-padding);
  color: var(--subtitle-color);
}
.color-cell {
  padding: 2px 4px;
  border-radius: var(--main-radius);
  white-space: nowrap;
  font-size: 14px;
  color: var(--color-cell-color);
}
.color-cell_type_tag {
  background-color: var(--accent-color);
}
.tests-counters-by-status {
  display: flex;
  gap: 2px;
  flex-grow: 1;
  flex-shrink: 0;
  justify-content: flex-end;
  align-items: flex-start;
}
.tests-counters-by-status__cell {
  padding: 2px;
  display: flex;
  gap: 2px;
  border-radius: 20px;
  white-space: nowrap;
  align-items: center;
  transition: transform 0.15s ease-in;
  font-size: 11px;
  line-height: 11px;
  color: var(--font-color);
}
.step__head::before,
.tests-directory__title::before,
.test-link::before,
.tests-counters-by-status__cell::before {
  --offset: 0px;
  --icon-size-without-offset: calc(var(--icon-size) - 2 * var(--offset) - 2 * var(--border-width));

  content: '';
  width: var(--icon-size-without-offset);
  height: var(--icon-size-without-offset);
  margin: 0 calc(var(--offset) + var(--border-width));
  flex-shrink: 0;
  display: block;
  box-sizing: border-box;
  border-radius: 50%;
  outline: var(--border-width) solid;
  outline-offset: var(--offset);
  background-clip: content-box;
  background-position: 50% 50%;
  background-repeat: no-repeat;
  overflow: hidden;
}
.step__head::before,
.test-link::before {
  --border-width: 0px;
  --icon-size: 12px;
  --icon-line-width: 2px;

  font-weight: bold;
  transition: transform 0.15s ease-in;
}
.tests-counters-by-status__cell::before {
  --icon-size: 12px;
  --offset: 2px;
  --border-width: 1px;
  --icon-line-width: 1px;

  margin: calc(var(--offset) + var(--border-width));
  opacity: 0.7;
}
.tests-counters-by-status__cell:hover {
  position: relative;
  background-color: var(--tests-counters-by-status-cell-bg-color);
  transform: translate(-25%, 0px) scale(1.75);
  z-index: 12;
}
.retry-link,
.test-link,
.tests-directory__title,
.step__head {
  border-radius: var(--main-radius);
}
.test-link[data-status='passed']::before,
.tests-counters-by-status__cell[data-status='passed']::before,
.step[data-status='passed'] > .step__details > .step__head::before,
.step[data-status='passed'] > .step__head::before {
  color: var(--passed-color);
  background-image:
    linear-gradient(var(--transparent-color) calc(100% - var(--icon-line-width)), currentColor 0),
    linear-gradient(
      90deg,
      var(--transparent-color) calc(100% - var(--icon-line-width)),
      currentColor 0
    );
  background-size: 37% 70%;
  rotate: 45deg;
}
.test-link[data-status='passed']::before,
.step[data-status='passed'] > .step__details > .step__head::before,
.step[data-status='passed'] > .step__head::before {
  border-bottom-right-radius: 0px;
  background-size: 56% 100%;
  translate: 0 -15%;
}
.test-link[data-status='failed']::before,
.tests-counters-by-status__cell[data-status='failed']::before,
.step[data-status='failed'] > .step__details > .step__head::before,
.step[data-status='failed'] > .step__head::before {
  color: var(--failed-color);
  background-image:
    linear-gradient(
      45deg,
      var(--transparent-color) calc(50% - var(--icon-line-width) / 2),
      currentColor 0 calc(50% + var(--icon-line-width) / 2),
      var(--transparent-color) 0
    ),
    linear-gradient(
      135deg,
      var(--transparent-color) calc(50% - var(--icon-line-width) / 2),
      currentColor 0 calc(50% + var(--icon-line-width) / 2),
      var(--transparent-color) 0
    );
}
.test-link[data-status='broken']::before,
.tests-counters-by-status__cell[data-status='broken']::before {
  --border-width: 1px;
  --offset: 0px;

  border-radius: 50%;
  color: var(--broken-color);
  background-image: linear-gradient(
    135deg,
    var(--transparent-color) calc(50% - var(--icon-line-width) / 2),
    currentColor 0 calc(50% + var(--icon-line-width) / 2),
    var(--transparent-color) 0
  );
}
.test-link[data-status='skipped']::before,
.tests-counters-by-status__cell[data-status='skipped']::before {
  color: var(--skipped-color);
}
.test-link[data-status='skipped']::before,
.tests-counters-by-status__cell[data-status='skipped']::before,
.tests-directory[open] > .tests-directory__title::before {
  background-image: linear-gradient(
    var(--transparent-color) calc(50% - var(--icon-line-width) / 2),
    currentColor 0 calc(50% + var(--icon-line-width) / 2),
    var(--transparent-color) 0
  );
}
.test-link[data-status='unknown']::before,
.tests-counters-by-status__cell[data-status='unknown']::before {
  content: '?';
  display: flex;
  justify-content: center;
  align-items: center;
  color: var(--unknown-color);
}
.test-link[data-status='manual']::before {
  --offset: 0px;
}
.tests-counters-by-status__cell[data-status='passed']::before,
.tests-counters-by-status__cell[data-status='unknown']::before,
.tests-counters-by-status__cell[data-status='manual']::before {
  --offset: 1px;
}
.test-link[data-status='manual']::before,
.tests-counters-by-status__cell[data-status='manual']::before {
  color: var(--manual-color);
  background:
    linear-gradient(
      var(--transparent-color) calc(50% - var(--icon-line-width) / 2),
      currentColor 0 calc(50% + var(--icon-line-width) / 2),
      var(--transparent-color) 0
    ),
    linear-gradient(
      90deg,
      var(--transparent-color) calc(50% - var(--icon-line-width) / 2),
      currentColor 0 calc(50% + var(--icon-line-width) / 2),
      var(--transparent-color) 0
    ),
    linear-gradient(
        90deg,
        currentColor calc(var(--icon-line-width) + 8%),
        var(--transparent-color) 0
      )
      0px 60% / 100% 46%,
    linear-gradient(currentColor calc(var(--icon-line-width) + 8%), var(--transparent-color) 0) 60%
      0px / 46% 100%;
  background-repeat: no-repeat;
  rotate: 45deg;
}
.tests-counters-by-status__cell:hover::before {
  opacity: 1;
}
.color-cell[data-status='passed'] {
  background-color: var(--passed-color);
}
.color-cell[data-status='manual'] {
  background-color: var(--manual-color);
}
.color-cell[data-status='skipped'] {
  background-color: var(--skipped-color);
}
.color-cell[data-status='failed'] {
  background-color: var(--failed-color);
}
.color-cell[data-status='broken'] {
  background-color: var(--broken-color);
}
.color-cell[data-status='unknown'] {
  background-color: var(--unknown-color);
}
.retry-link,
.test-link,
.test-tabs__button {
  min-height: 42px;
}
.test-details__path {
  margin: 0;
  padding: var(--test-details-padding);
  font-size: 18px;
  color: var(--subtitle-color);
  overflow-wrap: break-word;
}
.test-details__title {
  margin: 0;
  padding: var(--test-details-padding);
  font-size: 18px;
  line-height: 24px;
  font-weight: 400;
  overflow-wrap: break-word;
}
.test-details__title .color-cell {
  margin-right: 10px;
  position: relative;
  font-size: 16px;
}
.test-tabs {
  position: relative;
  display: flex;
  background-color: var(--secondary-bg-color);
  white-space: nowrap;
  scroll-snap-type: x mandatory;
  overflow-x: auto;
}
.test-tabs__button {
  position: relative;
  padding: 11px calc(var(--test-details-padding) + 4px) 14px;
  width: 100px;
  border: none;
  font-size: 16px;
  color: var(--font-color);
  transition: all 0.3s ease;
  text-transform: uppercase;
  scroll-snap-align: start;
}
.test-tabs__button[aria-selected='true']::after {
  content: '';
  position: absolute;
  left: 0;
  right: 0;
  bottom: 0;
  width: 100px;
  height: 3px;
  background-color: var(--accent-color);
  transition: transform 0.2s ease 0s;
  transform-origin: 0px 0px;
}
.test-tabs__button,
.test-tabs__button:focus,
.test-tabs__button:active,
.test-tabs__button:hover {
  background-color: var(--secondary-bg-color);
}
.test-tabs__button:not(:disabled):hover::before,
.test-tabs__button:not(:disabled):focus::before,
.test-tabs__button:not(:disabled):active::before {
  content: '';
  position: absolute;
  top: 7px;
  left: var(--test-details-padding);
  right: var(--test-details-padding);
  bottom: 10px;
  border: 2px solid var(--accent-color);
  border-radius: var(--main-radius);
}
.test-tabs__button[aria-selected='true'],
.test-tabs__button[aria-selected='true']:hover,
.test-tabs__button[aria-selected='true']:active,
.test-tabs__button[aria-selected='true']:focus {
  position: relative;
  color: var(--accent-color);
  cursor: default;
}
.drag-container {
  display: none;
}
.test-error {
  box-sizing: border-box;
  margin: 0 var(--test-details-padding);
  padding: var(--test-details-padding);
  border: 1px solid hsl(0 100% 35% / 0.3);
  border-left: 4px solid var(--failed-line-color);
  border-radius: var(--main-radius);
  font-family: ui-monospace, SFMono-Regular, Consolas, monospace;
  color: var(--failed-text-color);
  background-color: var(--failed-status-bg-color);
}
.test-error__content {
  overflow: auto;
  scrollbar-gutter: stable;
  white-space: pre;
  max-width: 100%;
  max-height: 800px;
}
.empty-state {
  padding: var(--test-details-padding);
}
.test-details__retry-title + .empty-state {
  padding-top: 0;
}
.test-details__retry-title {
  margin: 0 0 10px 0;
  padding: 15px var(--test-details-padding) 0;
  font-size: 20px;
  font-weight: normal;
}
.test-details__retry-title + .test-description {
  padding-top: 0;
}
.test-description {
  margin: 0 0 15px 0;
  padding: 15px var(--test-details-padding) 0;
}
.test-description__term {
  display: inline-block;
  color: var(--subtitle-color);
}
.test-description__term::after {
  content: ':';
}
.test-description__definition {
  margin: 0;
  display: inline;
  overflow-wrap: break-word;
}
.test-description__definition::after {
  margin: 0 0 7px 0;
  display: block;
  content: '';
}
.test-description__definition .color-cell {
  font-size: 12px;
  font-weight: normal;
}
.test-description__definition .color-cell:not(:last-child) {
  margin: 0 5px 0 0;
}
.steps-group {
  --horizontal-level-offset: clamp(14px, 2.5cqw, 25px);
  --vertical-level-offset: 10px;
  --popover-button-width: 30px;
  --timeline-width: 3px;
  --timeline-point-diameter: 9px;
  --timeline-border-radius: 7px;
  --timeline-top-offset: calc(var(--step-head-padding-top-bottom) + var(--half-line-height));
  --timeline-left-offset: 15px;
  --timeline-color: hsl(0 0% 45%);
  --focus-line-color: hsl(0 0% 64%);
  --icon-size: 13px;
  --step-head-margin-right: var(--test-link-margin-left-right, 3px);
  --step-head-padding-top-bottom: var(--test-link-padding-top-bottom, 8px);
  --step-head-padding-left-right: var(--test-link-padding-left-right, 10px);
  --timeline-horizontal-line-width: 20px;
  --details-open-summary-margin-bottom: 15px;
  --timeline-border-bottom-left-radius: var(--timeline-border-radius);
  --timeline-bend-top-left-border-width: 0 0 var(--timeline-width) var(--timeline-width);
  --timeline-bend-top-right-border-width: var(--timeline-width) var(--timeline-width) 0 0;
  --timeline-before-box-shadow: 0 calc(-1 * var(--timeline-border-radius)) 0 0
    var(--primary-bg-color);

  position: relative;
  padding-left: 0;
  contain: layout paint;
  overflow: hidden;
  background: var(--primary-bg-color);
}
.steps-group:not(.steps-group .steps-group) {
  container-type: inline-size;
}
.step {
  --level: 0;
  --icon-margin-right: 7px;
  --arrow-color: hsl(0 0% 32%);

  position: relative;
  box-sizing: border-box;
  min-height: 38px;
  padding-left: var(--popover-button-width);
  padding-bottom: 1px;
  list-style-type: none;
}
.step__head {
  display: grid;
  grid-template-columns: auto 1fr auto;
  gap: 5px;
  box-sizing: border-box;
  min-width: 0;
